export const Booklist = ({ language, hoge, getData }) => {
    const [bookData, setBookData] = useState(null);

    useEffect(() => {
        const result = getData?.(language).then((response) => {
            console.log(response);
            setBookData(response)
        });
    }, [language, getData]);

    console.log(bookData);
    // const result = getData?.(language);
    return (
        <>
            <ul>
                {bookData === null ? (
                    <p>now loading...</p>
                ) : (
                        bookData.data.items.map((x, index) => (
                        <>
                                <li key={index}><a href={x.volumeInfo.previewLink}>{x.volumeInfo.title}</a></li>
                                {/* <img src={x.volumeInfo.imageLinks.smallThumbnail} alt="" key={index}/> */}
                        </>
                    ))
                )}
            </ul>
            {/* <p>this is {JSON.stringify(bookData)} list component {hoge}</p> */}
        </>
    );
};
